### Procedure:
To a solution of 1,5-dimethyltetrazole (4.6 g, 4.7 mmoles) in tetrahydrofuran (40 mL) at -50° C. was added butyl lithium solution (21.4 mL of a 2.2 M solution, 4.7 mmoles). After stirring for 10 minutes, a solution of 2,2'-difluoro-4,4'-dimethylbenzophenone in tetrahydrofuran (15 mL) was added. The solution was stirred for 2.5 hours during which time it was allowed to warm to -10° C. The reaction was quenched by adding 1N hydrochloric acid. The layers were separated and the aqueous layer was extracted with methylene chloride. The combined organic fractions were dried (MgSO4) was evaporated. The residue was triturated with diethyl ether and crystallized from isopropyl acetate to give 8.0 g of the title compound; m.p.=150°-151° C. MS: M+ =344.

