### Procedure:
E-2'-fluoro-2-hydroxy-4-methoxy-3-methylbenzophenone O-acetyl oxime (22.0 g) is dissolved in 100 ml of DMF and added to a suspension of 2.5 g NaH in 100 ml DMF. An ice bath is applied to keep the reaction temperature <30° C. After 40 minutes the reaction is poured into H2O and extracted with ether. After washing well with H2O, the ether is dried and evaporated to give a crystalline product that is washed with cold hexane to give 3-(2-fluorophenyl)-6-methoxy-7-methyl-1,2-benzisoxazole, mp 105°-108° C.

