            m1, m4, m2, m3 = m1_m4_m2_m3.split(" of ")
            inputs["m1_m4_m2_m3"] = {"components": [{"identifiers": [{"type": "NAME", "value": m1"}], "reaction_role": "REACTANT"}, {"identifiers": [{"type": "NAME", "value": m2"}], "reaction_role": "REACTANT"}, {"identifiers": [{"type": "NAME", "value": m3"}], "reaction_role": "REACTANT"}, {"identifiers": [{"type": "NAME", "value": m4"}], "reaction_role": "SOLVENT"}]}
        elif "After" in line:
            m5_m6 = line.split("After")[1].strip()
            m5, m6 = m5_m6.split(" sodium triacetoxyborohydride")
            inputs["m5_m6"] = {"components": [{"identifiers": [{"type": "NAME", "value": m5"}], "reaction_role": "REACTANT"}, {"identifiers": [{"type": "NAME", "value": m6"}], "reaction_role": "REACTANT"}]}
        elif "The solvent was removed under vacuum" in line:
            workups.append({"type": "CUSTOM", "details": "The solvent was removed under vacuum"})
        elif "the residue was redissolved in EtOAc" in line:
            workups.append({"type": "DISSOLUTION", "details": "the residue was redissolved in EtOAc", "input": {"components": [{"identifiers": [{"type": "NAME", "value": "EtOAc"}], "reaction_role": "WORKUP"}]}})
        elif "The organic phase was washed twice with an aqueous solution (1N) of NaOH" in line:
