        elif "the solvent removed under vacuum" in line:
            workups.append({"type": "CUSTOM", "details": "the solvent removed under vacuum"})

    reaction_info["inputs"] = inputs
    reaction_info["workups"] = workups
    reaction_info["outcomes"] = outcomes

    return reaction_info

