To a suspension of 0.31 g of 1-cyclopropyl-7-{2-[(1,3-dioxo-2,3-dihydro-1H-2-isoindolyl)methyl]-6-methyl-4-pyridyl}-8-methyl-4-oxo-1,4-dihydro-3-quinolinecarboxylic acid ethyl ester in 2 ml of methanol was added 1.78 ml of an aqueous 1 mol/l sodium hydroxide solution and the mixture was stirred at room temperature for 1 hour. The reaction mixture was adjusted to pH 5.3 with 1 mol/l hydrochloric acid and then precipitated crystals were filtered. The obtained crystals were dissolved in 6 mol/l hydrochloric acid and the solution was stirred with heating at 100\u00b0 C. for 4 hours. After cooling the reaction mixture to room temperature, insoluble matter was filtered off. The filtrate was concentrated under reduced pressure. Ethanol was added to the obtained residue and precipitates were filtered to obtain 0.15 g of 7-[2-(aminomethyl)-6-methyl-4-pyridyl]-1-cyclopropyl-8-methyl-4-oxo-1,4-dihydro-3-quinolinecarboxylic acid hydrochloride. The obtained hydrochloride was dissolved in a mixed solvent consisting of 1.2 ml of ethanol and 1.2 ml of water. After adding 1.2 ml of an aqueous 1 mol/l sodium hydroxide solution to the resulting solution, carbon dioxide gas was blown therein. Filtration of the precipitates afforded 0.10 g of colorless crystals of 7-[2-(aminomethyl)-6-methyl-4-pyridyl]-1-cyclopropyl-8-methyl-4-oxo-1,4-dihydro-3-quinolinecarboxylic acid.

